import { useMemo } from 'react'
import { GoogleMap, useLoadScript } from '@react-google-maps/api'



const Map = ({center, zoom}) => {

    const { isLoaded } = useLoadScript({
        googleMapsApiKey: "AIzaSyD1VRy7RkyWy-Yqw3-OfLSBGKCIFjKnMZI",
    })

    if(!isLoaded) return <div>Loading...</div>

    return (
    <GoogleMap zoom={zoom} center ={center} mapContainerClassName="map-container"></GoogleMap>
  )
}

Map.defaultProps = {
  center : {
    lat: 36.539,
    lng: -122,
  },
  zoom : 14,
}

export default Map
